[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?ingredient ?label ?kegg ?cas ?chebi ?pubchem
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?ingredient a schema:Ingredient ;
              rdfs:label ?label .
  ?label bif:contains "'glucose'"
  OPTIONAL { ?ingredient schema:hasKEGG ?kegg }
  OPTIONAL { ?ingredient schema:hasCAS ?cas }
  OPTIONAL { ?ingredient schema:hasChEBI ?chebi }
  OPTIONAL { ?ingredient schema:hasPubChem ?pubchem }
}
LIMIT 20"}}]

[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "ensembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ensembl", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX terms: <http://rdf.ebi.ac.uk/terms/ensembl/>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX taxonomy: <http://identifiers.org/taxonomy/>

SELECT (COUNT(DISTINCT ?EnsemblGene) AS ?count)
FROM <http://rdfportal.org/dataset/ensembl>
WHERE {
    ?EnsemblGene a terms:EnsemblGene ;
        obo:RO_0002162 taxonomy:9606 .
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT ?disease ?label ?notificationNumber
WHERE {
  ?disease rdfs:label ?label .
  ?disease nando:notificationNumber ?notificationNumber .
  FILTER(CONTAINS(LCASE(?label), "parkinson"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT ?disease ?label ?altLabel ?notificationNumber
WHERE {
  ?disease a nando:Disease .
  OPTIONAL { ?disease rdfs:label ?label . }
  OPTIONAL { ?disease nando:hasNotificationNumber ?notificationNumber . }
  OPTIONAL { ?disease rdfs:label ?altLabel . }
  FILTER(CONTAINS(LCASE(STR(?label)), "parkinson") || CONTAINS(LCASE(STR(?altLabel)), "parkinson"))
}
LIMIT 10
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?disease ?en_label ?ja_label ?notificationNumber
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           rdfs:label ?en_label ;
           nando:hasNotificationNumber ?notificationNumber .
  OPTIONAL {
    ?disease rdfs:label ?ja_label .
    FILTER(LANG(?ja_label) = "ja" && !REGEX(STR(?ja_label), "^[ぁ-ん]+$"))
  }
  ?en_label bif:contains "'Parkinson*'" option (score ?sc) .
  FILTER(LANG(?en_label) = "en")
}
ORDER BY DESC(?sc)
LIMIT 10
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?strainLabel ?collectionLabel ?link
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?strainLabel ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .
  FILTER(CONTAINS(LCASE(?genus), "thermotoga"))
  FILTER(CONTAINS(LCASE(?species), "maritima"))

  OPTIONAL {
    ?ccn a schema:CultureCollectionNumber ;
         schema:describesStrain ?strain ;
         rdfs:label ?collectionLabel ;
         schema:hasLink ?link .
  }
}
ORDER BY ?strainLabel
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT DISTINCT ?collectionLabel
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .
  FILTER(CONTAINS(LCASE(?genus), "thermotoga"))
  FILTER(CONTAINS(LCASE(?species), "maritima"))

  ?ccn a schema:CultureCollectionNumber ;
       schema:describesStrain ?strain ;
       rdfs:label ?collectionLabel .
}
ORDER BY ?collectionLabel"}}]
